import React from 'react';
import cat from '../cat.jpg';
import * as Bs from 'react-bootstrap';


class Home extends React.Component{
  
    render() {
      return(
        <Bs.Container>
            <Bs.Row className="justify-content-md-center">
              <Bs.Image src={cat} fluid />
            </Bs.Row>
        </Bs.Container>
      );
    }
  }
  
  export default Home;
